import React from "react";
import { Link } from "react-router-dom";
import hardwareSoftware from "../images/hardware_software_example_1.png";
import booking from "../images/booking_example_1.png";
import madd from "../images/madd_example_1.png";
import atem from "../images/atem.png";
import face from "../images/face.png";
import insta from "../images/insta.png";
import aboutIllus from "../images/about_ill.png";

function Home() {
  return (
    <div className="main">
      <div className="rowWithMargin verticalPaddingM col">
        <br />
        <br />
        <p className="montserrat bold regBlueText underNegativeMargin">
          ABOUT CSIL
        </p>
        <p className="redText xxlText">
          Serving students and faculty for nearly 30 years
        </p>

        <div className="rowM">
          <div className="col aboutColLeft">
            <p className="blackText">
              Welcome to the University of Chicago Computer Science
              Instructional Laboratory (CSIL)! Since 1989, CSIL has provided
              students, faculty, and university affiliates with a variety of
              computing services. Located on the first floor of the John Crerar
              Library, CSIL offers a wide range of services - from hardware
              support to computer software to minicourse lessons. Contact us if
              you have any questions or would like to reserve a lab.
            </p>
          </div>
          <div className="col aboutColRight">
            <img
              src={aboutIllus}
              alt="about illustration"
              className="aboutIllus"
            />
          </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
